/*引入Vue*/
import Vue from 'vue'
/*引入App*/
import App from './App.vue'
/*按需引入*/
import { Button,Row,DatePicker } from 'element-ui';

Vue.component(Button)
Vue.component(Row)
Vue.component(DatePicker)
/*关闭Vue的生产提示*/
Vue.config.productionTip=false
/*创建vm*/
new Vue({
	el:'#app',
	render: h => h(App),
})
